import * as React from 'react'
import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Calendar from './Calendar';
import Paper from '@mui/material/Paper';
function Schedule() {
    const [viewtype, setviewtype] = React.useState('Calendar');
    //width: '100vw', height: '100vh'
    return(
        <div>
            <Box className='schedule'sx={{position: 'relative', top: '60px'}}>
            <Stack spacing={0} direction="row" sx={{display: 'flex', justifyContent:'center',
            alignItems:'center',margin: 'auto', width: '70vw'}}>
                <Button onClick={() => {
                setviewtype('List');
                }}>List</Button>
                <Button onClick={() => {
                setviewtype('Calendar');
                }}>Calendar</Button>
            </Stack>
            </Box>
            <Box>
                {viewtype === 'Calendar' ? (
            <Calendar/>
            ) : viewtype === 'List' ? (
            <div>HOLY SHIT I JUST HIT A CLIP</div>
            ) : null}
            </Box>
        </div>



    );
}

export default Schedule;
